Καθιστούν τους στόχους δυσκολότερους να τους επιτεθούν με επιτυχία και αποτρέπουν τις επιθέσεις κάνοντας πιο πιθανή τη σύλληψη. Δικαιούμαστε να πούμε ότι "Έκαναν τους στόχους τόσο εύκολους που πιάστηκαν μέσα σε λίγα λεπτά."; Ναι, όχι, ή ίσως;
Οχι

Δεν χρειάζεται να μείνεις εκεί. Δικαιούμαστε να πούμε ότι "Πρέπει να μείνετε σε αυτό ακριβώς το σημείο!"; Ναι, όχι, ή ίσως;
Οχι

Μία ερμηνεία ότι οι αποδέκτες των νομικών υπηρεσιών μπορούν να εκπροσωπούν αλλοδαπούς μόνο κατά τη διάρκεια της παρουσίας τους στις Ηνωμένες Πολιτείες θα παρουσίαζαν στους παρόχους των αποδεκτών νομικών υπηρεσιών δύο επιλογές. Δικαιούμαστε να πούμε ότι "Οι περισσότεροι αλλοδαποί δεν ψάχνουν για νομικές υπηρεσίες όταν τις έχουν ανάγκη."; Ναι, όχι, ή ίσως;
Μπορεί

Λοιπόν, δεν το σκέφτηκα καν, αλλά ήμουν τόσο απογοητευμένος, και κατέληξα να του μιλάω και πάλι. Δικαιούμαστε να πούμε ότι "Δεν του μίλησα ξανά."; Ναι, όχι, ή ίσως;
